import { useMutation } from '@tanstack/react-query';
import axios from 'axios';

const URL = "https://github.com/graphql-compose/graphql-compose-examples/blob/master/examples/northwind/data/json/categories.json";

const submitQuery = () => axios.get(URL, { 'content-type': 'text/csv;charset=UTF-8','Access-Control-Allow-Origin': '*' })

const useSubmitQuery = () => useMutation({ mutationFn: submitQuery, mutationKey: 'SUBMIT_QUERY'})

export default useSubmitQuery;
